import React,{Component} from 'react';
import Team from './Team';
import Teamview from './Teamview';


class App extends Component{

    render(){
        return(
            <div className='container'>
                <h1 className='text-center bg-primary'>React js </h1>
                <Team/>
                <Teamview />
            </div>
            
        )
    }
}

export default App;
